    public function addTrip($data)
    {
        $data = explode("|", $data);
        // dd($data);
        $serial           = $data[0];
        $date             = Carbon::parse($data[1])->format('Y-m-d');
        $challan          = $data[2];
        $party_name       = $data[3];
        $vehicle_num      = $data[4];
        $agent            = $data[5];
        $tp_num           = $data[6];
        $tp_ser           = $data[7];
        $project          = $data[8];
        $net_weight       = $data[9];
        $rate             = $data[10];
        $premium_rate     = $data[11];
        $total_amt        = str_replace(",", "", $data[12]);
        $hsd              = str_replace(",", "", $data[13]);
        $cash_adv         = str_replace(",", "", $data[14]);
        $net_payable      = str_replace(",", "", $data[15]);
        $tds              = str_replace(",", "", $data[16]);
        $cash_adv_charges = str_replace(",", "", $data[17]);
        $two_pay          = str_replace(",", "", $data[18]);
        $payment_amt      = str_replace(",", "", $data[19]);
        $payment_date     = Carbon::parse($data[20])->format('Y-m-d');
        $acc_num          = $data[21];
        $ifsc_code        = $data[22];
        $pan              = $data[23];

        $trip = new Trip;

        $trip->date = $date;
        // $trip->driver_id = null;

        if ($challan != "null") {
            $trip->challan_serial = $challan;
        }

        $party = Party::firstOrCreate([
            'pan'        => $pan,
            'company_id' => 2,
        ], [ 'name' => $party_name ]);
        AddBankAccountToModels::run($party_name, $acc_num, $ifsc_code, $party);
        $trip->party_id = $party->id;


        $trip->market_vehicle_id = MarketVehicle::firstOrcreate([
            'number'     => $vehicle_num,
            'party_id'   => $trip->party_id,
            'company_id' => "2",
        ])->id;
        $trip->project_id        = Project::firstOrCreate([ 'name' => $project ])->id;
        $trip->tp_number         = $tp_num;
        $trip->tp_serial         = $tp_ser;
        $trip->net_weight        = $net_weight;
        $trip->rate              = $rate;
        $trip->premium_rate      = $premium_rate;
        $trip->amount            = $total_amt;

        $trip->hsd = $hsd;

        $trip->cash          = $cash_adv;
        $trip->cash_adv_pct  = "2";
        $trip->cash_adv_fees = $cash_adv_charges;

        $trip->tax_category_id = 1;
        $trip->tds             = $tds;

        $trip->two_pay = $two_pay;

        $trip->final_payable = $payment_amt;

        $trip->step_loading = 1;
        $trip->step_payment = 1;

        $trip->agent_id = Agent::firstOrCreate([
            'name'       => ucfirst($agent),
            'company_id' => "2",
        ])->id;
        //        $trip->created_by = 5;
        //        $trip->finished_by = 3;
        $trip->company_id = 2;

        $trip->save();

        //        $trip_payment = TripPaymentTransaction::create(['party_id' => $trip->party_id, 'amount' => $payment_amt, 'parties_bank_account_id' => $create_bank, 'trip_id' => $trip->id, 'status' => '1', 'payment_method_id' => '4', 'created_at' => Carbon::parse($payment_date)->format('Y-m-d h:m:s')])->id;
        //        $trip->trip_payment_transaction_id = $trip_payment;
        //        $trip->save();
    }

